import styled from 'styled-components';
import { InputBtn } from './TodoInput';

const ListContainer = styled.ul`
  position: relative;
  background-color: #fff;
  width: 100%;
  height: 80%;
  padding: 10px;
`

const List = styled.li`
  list-style: none;
  border-bottom: 4px solid #909DD9;
  width: 30%;
  margin-bottom: 10px;
`

export function TodoList({todos}){

  return (
    <>
      <ListContainer>
        {todos.map(todo => {
          return (<List key={todo.id}>
            {todo.todo}
          </List> )
        })}
        {/* <InputBtn/> */}
      </ListContainer>
    </>
  )
}
